import React from 'react';
import GameBoard from './GameBoard';

function GameLobby({ username, socket }) {
  return (
    <div className="game-lobby">
      <h2>Game Lobby</h2>
      <GameBoard username={username} socket={socket} />
    </div>
  );
}

export default GameLobby;
